import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class HomeService {

  private communities: { name: string, filtersList: string[], selected: boolean  }[] = [];
  private currentConferences: string[] = [];

  get Communities() {
    return this.communities;
  }

  set PublicationsByYear( communities: { name: string, filtersList: string[], selected: boolean  }[] ) {
     this.communities = communities;
  }

  get CurrentConferences() {
    return this.currentConferences;
  }

  set CurrentConferences( currentConferences: string[]) {
     this.currentConferences = currentConferences;
  }




}
